import time
class Solution(object):
    def smallestRange(self, nums):
        """
        :type nums: List[List[int]]
        :rtype: List[int]
        """
        start = time.clock()
        ans,k = [],len(nums)
        for i,v in enumerate(nums):
            ans += [(m,i) for m in v]
        ans.sort()
        #print "Sort done", k,ans,  len(ans)
        rc,mrv,mr,tally = {},(-1,-1),1000000,0
        for i,v in enumerate(ans):
            if v[1] in rc:
                rc[v[1]] += 1
            else:
                rc[v[1]] = 1
                tally += 1
                if tally == k: break
        l,r = 0, i
        while True:
            #print "Iter ",l,r
            if ans[r][0] - ans[l][0] < mr:
                mr,mrv = ans[r][0] - ans[l][0], [ans[l][0],ans[r][0]]
                #print "Check ",l,r, mrv
            lrem = -1
            while lrem == -1:
                lid = ans[l][1]
                l+=1
                rc[lid] -= 1
                if rc[lid] == 0: 
                    lrem = lid
                else:
                    if ans[r][0] - ans[l][0] < mr:
                        mr,mrv = ans[r][0] - ans[l][0], [ans[l][0],ans[r][0]]
                    #print "Check ",l,r, mrv
            r+=1
            if r == len(ans): 
                #print "Return done"
                #print time.clock() - start
                return mrv
            while ans[r][1] != lrem:
                rc[ans[r][1]] += 1
                r+=1
                if r == len(ans): 
                    #print "Return done l"
                    #print time.clock() - start
                    return mrv
            rc[ans[r][1]] += 1

                

